import { theme } from '../theme'
import gameOfLife from '../game-of-life/game-of-life'
import gravitationalAttraction from '../gravitational-attraction/gravitational-attraction'
import mathMotion from '../math-motion/math-motion'

const sketchs = {
  'game-of-life': gameOfLife,
  'gravitational-attraction': gravitationalAttraction,
  'math-motion': mathMotion
}

let canvas = null

function tween(props) {
  const defaultCanvas = document.getElementById('defaultCanvas0')
  TweenMax.to(defaultCanvas, 0.3, props)
}

function play() {
  canvas.play()
}

function stop() {
  canvas.stop()
}

function reset() {
  canvas.reset()
}

function showBackgroundSketch() {
  canvas.play()

  tween({ autoAlpha: 0.5, delay: 0.3 })
}

function hideBackgroundSketch() {
  canvas.stop()

  tween({ autoAlpha: 0 })
}

export default class BackgroundSketchElement extends HTMLElement {
  static get observedAttributes() {
    return ['slug', 'state']
  }

  constructor() {
    super()

    this.innerHTML = `
      <style>
        .texture {
          background: url('data:image/png;base64,') repeat 60%/120px 120px;
          height: 100%;
          left: 0;
          pointer-events: none;
          position: fixed;
          right: 0;
          width: 100%;
          z-index: 2;
        }
        canvas {
          display: none;
          left: 50%;
          opacity: 0;
          position: fixed;
          top: 50%;
          transform: translate(-50%, -50%);
          z-index: 1;
        }
        @media (min-width: ${theme.breakpoints.md}) {
          canvas {
            display: block;
            opacity: .5;
          }
        }
      </style>
      <div class="texture"></div>
    `
  }

  connectedCallback() {
    this.addEventListener('show-background-sketch', showBackgroundSketch)
    this.addEventListener('hide-background-sketch', hideBackgroundSketch)

    this.addEventListener('stop-sketch', stop)
    this.addEventListener('play-sketch', play)
    this.addEventListener('reset-sketch', reset)
  }

  attributeChangedCallback(attr, oldValue, newValue) {
    if (attr === 'slug') {
      if (canvas) {
        canvas.remove()
      }

      canvas = new p5(sketchs[newValue], this)
    }

    if (attr === 'state') {
      // ...
    }
  }
}

if (!customElements.get('background-sketch')) {
  customElements.define('background-sketch', BackgroundSketchElement)
}
